import React from 'react'

export default function Results(props) {
	console.log(props)
	return (
		<div>
			<h1>Results</h1>
			<span>Score is : {props.score}</span>
			<span> / {props.totalQuestions} questions</span>
			<span>in {props.totalTurns} turns</span>
		</div>
	)
}
